import React from "react";
import logo from "./images/logo.png";
const Navbar = () => {
  return (
    <>
      <div className="header">
        <div className="container">
          <div className="logo">
            <a href="">
              <img src={logo} />
            </a>
          </div>
          <div className="nav_links"></div>
        </div>
      </div>
    </>
  );
};

export default Navbar;
